/*Estilos PEC2 Herramientas HTML+CSSS */

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    font: 400 16px/1.6 'Libre Franklin', sans-serif;
    color: #000;
}

h1, h2, h3 {
    font-weight: 700;
}

h2 {
    font-size: 2rem;
    line-height: 1em;
    margin-bottom: 1rem;
}

h3 {
    font-size: 1.5rem;
}

p {
    font-size: 1.1rem;
    margin-bottom: 1rem;
}

a {
    color:rgba(0, 0, 0, 1);
    text-decoration: none;
}

a:hover {
    color: rgba(213, 25, 25,1);
}

cite, address {
    font-style: normal;
}

abbr {
    text-decoration: none;
}

ul.striped {
    padding: 15px;
    font-size: 1.1rem;
    margin-bottom: 1rem;
    list-style-type: none;
}

ul.striped li {
    border-bottom: 1px solid rgba(0,0,0,0.3);
}

ul.noPics {
    list-style-type: none;
    padding: 0;
    margin-left: 0;
    font-size: 1rem;
    margin-bottom: 0; 
}

/*Classes para aumentar paddings*/
.pBottom15 {
    padding-bottom: 15px !important;
}

.pTop15 {
    padding-top: 15px !important;
}

.pTop50 {
    padding-top: 50px !important;
}

.pBottom50 {
    padding-bottom: 50px !important;
}

/*Clases aplicadas a las imgenes y videos del sitio */

.img-fluid {
    max-width: 100%;
    height: auto;
}

.img-rounded {
    border-radius: 50%;
}

.img-centered {
    display: block;
    margin: 15px auto;
}

.img-left {
    float: left;
    margin-right: 15px;
    margin-bottom: 1rem;
}

figure {
    width: 75%;
    margin: 30px auto;
}

figcaption {
    font-size: 0.8rem;
}

.video-fluid {
    position: relative;
    display: block;
    width: 100%;
    padding: 0;
    overflow: hidden;
}

.video-fluid-item {
    position: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 100%;
    border: 0;
}

.video-fluid::before {
    display: block;
    content: "";
    padding-top: 56.25%;
}

/*Classes para los elemnetos graficos */
.imgFluid {
    max-width: 100%;
    height: auto;
}


/*Clase para los lectores de pantalla*/
.sr {
    position:absolute;
    height:1px;    
    width:1px;    
    overflow:hidden;    
    clip:rect(1px, 1px, 1px, 1px);
}

/****************************
Contenedores
*****************************/
main {
    width: 100%;
}

section {
    width: 100%;
    padding: 50px 0;
}

header {
    width: 100%;
}

footer {
    padding-top: 30px;
    padding-bottom: 30px;    
    background-color: #000;
    color: #fff;
    text-align: center;
}
.clip:hover{
    clip-path: polygon(50% 0%, 61% 35%, 98% 35%, 68% 57%, 79% 91%, 50% 70%, 21% 91%, 32% 57%, 2% 35%, 39% 35%);
}
.background {
    background-color: rgba(136, 136, 136, 1);
}
/*para que se  aline la imagen destacada*/
figure{
    text-align: center;
    width: 100%;
}

/*contenedores que se adaptan*/
.container {
    margin-right: auto;
    margin-left: auto;
    padding-right: 15px;
    padding-left: 15px;
    width: 100%;
}
  
@media (min-width: 576px) {
    .container {
      max-width: 540px;
    }
}
  
@media (min-width: 768px) {
    .container {
      max-width: 720px;
    }
}
  
@media (min-width: 992px) {
    .container {
      max-width: 960px;
    }
}
  
@media (min-width: 1200px) {
    .container {
      max-width: 1140px;
    }
}

/*Contenedores para las columna*/
@media (min-width: 768px) {
    .flexContainer {
        display: flex;
        flex-wrap: wrap;

    }
    .spaceBetween {
        justify-content: space-between;
    }
  
}
.col4 {
    width: 100%;
    padding-left: 15px;
    padding-right: 15px;
}


@media (min-width: 768px) {
    
    .col4 {
        flex: 0 0 33.333333% ;
        max-width: 33.333333%;
    }
    
}

/**********************************
Mens de navegaci y logo
***********************************/

/*Men de navegaci principal, men idiomas,logo, titulo */
nav {
    text-align: center;
    font-weight: 600;
    margin-bottom: 30px;
}

nav ul {
    list-style: none;
    font-size: 1rem;
}

div.top {
    display: flex;
    flex-direction: column-reverse;
    justify-content: space-between;
    align-items: center;
    padding: 15px 30px;
    text-align: center;
}


div.top h3:hover {
    color: rgb(250, 250, 250);
    transition-duration: 2s;
  }

div.top img {
    max-width: 100%;
    
      }
div.top ul {
    list-style: none;
    margin-bottom: 15px;
}

div.top ul li {
    display: inline-block;
    font-size: 0.8rem;
}

div.top ul li::before {
    content: " | "; 
}

div.top ul li:first-child::before {
    content: ""; 
}

a.current {
    border-bottom: 2px solid #000;
}

@media (min-width: 768px) {
    nav ul li {
        display: inline-block;
        padding-left: 15px;
        padding-right: 15px;
        font-size: 1.5rem;
        font-weight: 700;
    }
    nav ul li:first-child {
        padding-left: 0;
    }
    nav ul li:last-child {
        padding-right: 0;
    } 
    div.top {
        flex-direction: row;
        align-items: flex-start;
    }
    
}


/*Breadcrumb*/
ul.breadcrumb {
    margin-top: 2rem;
    margin-bottom: 2rem;
    margin-left: 30px;
    list-style: none;
}

ul.breadcrumb li {
    display: inline-block;
}
  
ul.breadcrumb li + li {
    padding-left: 0.5rem;
}

ul.breadcrumb li + li::before {
    padding-right: 0.5rem;
    color: rgba(64, 64, 64, 1);
    content: "/";
}

ul.breadcrumb li a {
    color: rgba(64, 64, 64, 1);
}

ul.breadcrumb li a:hover, ul.breadcrumb li.current  {
    color: rgba(64, 64, 64, 0.8);
}

/****************************
Botones
*****************************/
.btn {
    display: inline-block;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    border: 1px solid transparent;
    padding: 0.375rem 0.75rem;
    font-size: 1rem;
    line-height: 1.5;
    text-transform: uppercase;
}

.btn {
    background-color: rgba(213, 25, 25, 1);
    color:#fff;
}

.btn:hover {
    background-color: rgba(213, 25, 25, .7);
    color: #000;
    cursor: pointer;
}

/****************************
Imagen portada front-end
*****************************/
.hero {
    height: 500px;
    margin-bottom: 50px;
    padding-top: 100px;
}

.hero p:first-child {
    font-size: 2.3rem;
    font-family: 'Merriweather', serif;
    font-weight: 700;
}

.hero p:nth-child(2) {
    font-size: 0.1rem;
    /*font-weight: 50;*/
}

@media (min-width: 768px) {
    .hero {
        height: 500px;
    }
    .hero p:first-child {
        font-size: 3.3rem;
        font-family: 'Merriweather', serif;
        font-weight: 700;
    }
    .hero p:nth-child(2) {
        font-size: 3rem;
        font-weight: 200;
    }
}


/****************************
Activitats
*****************************/
.titleActiv, .dates {
    font-size: 1rem;
    line-height: 1em;
}

.titleActivForm {
    font-size: 1rem;
    padding: 15px;
    background-color: rgba(0,0,0,0.3);
    text-align: center;
}

.dates {
    font-size: 1.2rem;
    line-height: 1em;
}

.dates span {
    font-size: 0.8em;
}

.textDecor {
    font-size: 1rem;
}

.nota {
    font-size: 0.8rem;
    display: block;
}

.textDecor::before {
    display: inline-block;
    margin: 0 1em 0.25em 0;
    height: 3px;
    content: " ";
    text-shadow: none;
    background-color: rgba(213, 25, 25, 1);
    width: 5%;
}

a img:hover {
    filter: grayscale(100%);
}

p.intro {
    font-size: 1.3rem;
    padding: 15px;
    border-top: 2px solid rgb(213,25,25);
    border-bottom: 2px solid rgb(213,25,25);
}
figure.center {
    text-align: center;
    width: 100%;
    margin-left: auto;
    margin-right: auto;
}

figure.center figcaption {
    font-size: 0.75rem;
}

@media (min-width: 768px) {
    figure.center {
        width: 75%;
        margin-left: auto;
        margin-right: auto;
    }
}


/****************************
Footer
*****************************/
footer ul li {
    display: inline-block;
    padding-left: 15px;
}

footer ul.menuFooter li {
    display: block;
}

@media (min-width: 768px) {
    footer ul.menuFooter li {
        display: inline-block;
        padding-left: 15px;
    }
}
footer ul li:first-child {
    padding-left: 0;
}

footer ul li:last-child {
    padding-right: 0;
} 

footer a {
    color: #fff;
}

footer a:hover {
    color: rgba(204, 0, 0, .7);
}


/*Estilos para el artculo */

article{
    text-align: justify;
}

article.article h2, article.article h3 {
    text-align: left;
}

div.autor {
    background-color: #F7F2F3;
    padding: 15px;
    overflow: auto;
}

p.meta {
    font-size: 1.3rem;
}

p.bio {
    margin-top: 50px;
    font-size: 1rem;
}

.intro {
    font-size: 1.6rem;
    margin-top: 3rem;
    margin-bottom: 2rem;
}

blockquote {
    border-right: 5px solid #FF3A20;
    background-color: #F7F2F3;
    padding: 15px 30px;
    margin: 15px 0;
}

article footer p {
    width: 80%;
    margin-left: auto;
    margin-right: auto;
    font-size: 0.75rem;
    text-align: center;
}
/*Ejemplo boton javascript*/
.p-boton {
    font-family: 'helvetica neue', helvetica, sans-serif;
    letter-spacing: 1px;
    text-transform: uppercase;
    text-align: center;
    border: 2px solid rgba(200, 0, 110,0.6);
    background: rgba(200, 0, 110,0.3);
    color: rgba(200, 0, 110,0.6);
    box-shadow: 1px 1px 2px rgba(200, 0, 110,0.4);
    border-radius: 10px;
    padding: 3px 10px;
    display: inline-block;
    cursor:pointer;
  }
    /*experimentos*/

    .move{

        color: #6d6d6e;
        transition: color 0.5s ease-out;  
        animation-duration: 3s;
            animation-name: slidein;
          }
          
          @keyframes slidein {
            from {
              margin-left: 100%;
              width: 300%; 
            }
          
            to {
              margin-left: 0%;
              width: 100%;
            } 
    }
